import s from './StylePizzaOrder/PizzaOrder.module.css'
import React from "react";
import {NavLink} from "react-router-dom";


class SnekOrder extends React.Component {
    render() {

        return (
            <div className={s.content}>
                <div className={s.container}>
                    <div className={s.photo_pizza}>
                        <img src={this.props.sneks.photoURL} alt="" height="450" width="450"/>
                    </div>
                    <div className={s.pizza_info}>
                        <div className={s.menu}>
                            <NavLink className={s.link_menu} to="/profile/sneks"> Меню/</NavLink><NavLink
                            className={s.link_pizza}
                            to="/profile/sneks"> Пица/</NavLink>
                            <span className={s.link_name_pizza}>{this.props.sneks.name}</span>
                        </div>
                        <div className={s.pizza}>
                            <div className={s.name_pizza}>{this.props.sneks.name}</div>
                            <div className={s.cost_pizza}> Від {this.props.sneks.cost} грн</div>
                            <div className={s.strukture_pizza}>{this.props.sneks.structure}</div>
                        </div>


                    </div>


                </div>
            </div>

        )
    }
}


export default SnekOrder
